/*Table structure for table `municipios` */

DROP TABLE IF EXISTS `municipios`;

CREATE TABLE `municipios` (
  `id_municipio` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `clave_inegi` int(3) unsigned zerofill DEFAULT NULL,
  `municipio` varchar(150) NOT NULL,
  `id_entidad` int(3) unsigned NOT NULL,
  `activo` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0:No, 1:Sí',
  `latitud` decimal(20,18) DEFAULT NULL,
  `longitud` decimal(20,18) DEFAULT NULL,
  `zoom` tinyint(2) DEFAULT NULL,
  `id_municipio_insejupy` int(10) DEFAULT '0',
  PRIMARY KEY (`id_municipio`),
  KEY `FK_municipios_estados` (`id_entidad`),
  CONSTRAINT `FK_municipios_estados` FOREIGN KEY (`id_entidad`) REFERENCES `entidades` (`id_entidad`)
