/*Table structure for table `propiedades` */

DROP TABLE IF EXISTS `propiedades`;

CREATE TABLE `propiedades` (
  `id_propiedad` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `titulo` varchar(150) NOT NULL,
  `descripcion` varchar(500) NOT NULL,
  `precio` decimal(20,2) unsigned NOT NULL DEFAULT '0.00' COMMENT 'Cantidad en pesos mexicanos',
  `id_tipo_propiedad` int(4) unsigned NOT NULL,
  `exclusiva` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0:No, 1:Sí',
  `recamaras` int(3) unsigned NOT NULL DEFAULT '0' COMMENT 'Número de recamaras',
  `banios` int(3) unsigned NOT NULL DEFAULT '0' COMMENT 'Número de baños',
  `garage_autos` int(3) unsigned NOT NULL DEFAULT '0' COMMENT 'Número de autos en garage',
  `niveles` int(3) unsigned NOT NULL DEFAULT '0' COMMENT 'Número de niveles o plantas',
  `anio_construccion` int(4) unsigned NOT NULL DEFAULT '0' COMMENT 'Año de construcción',
  `superficie_construccion` decimal(20,2) unsigned NOT NULL DEFAULT '0.00' COMMENT 'Expresado en metros cuadrados',
  `superficie_terreno` decimal(20,2) unsigned NOT NULL DEFAULT '0.00' COMMENT 'Expresado en metros cuadrados',
  `estado` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1:Publicada, 2:Vendida, 3:Rentada',
  `id_tipo_operacion` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '1:Venta, 2:Renta, 3:Renta por días, 4:Renta por vacaciones',
  `id_zona` int(3) unsigned NOT NULL,
  `id_asentamiento` int(10) unsigned NOT NULL,
  `codigo_postal` int(5) unsigned zerofill NOT NULL,
  `latitud` decimal(20,17) NOT NULL DEFAULT '0.00000000000000000',
  `longitud` decimal(20,17) NOT NULL DEFAULT '0.00000000000000000',
  `fecha_captura` datetime NOT NULL,
  `imagen1` varchar(50) NOT NULL DEFAULT '',
  `imagen2` varchar(50) NOT NULL DEFAULT '',
  `imagen3` varchar(50) NOT NULL DEFAULT '',
  `imagen4` varchar(50) NOT NULL DEFAULT '',
  `id_usuario` int(10) unsigned NOT NULL COMMENT 'Usuario que captura la propiedad',
  `id_periodicidad` int(10) DEFAULT NULL,
  `activo` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0:No, 1:Sí',
  `id_video_youtube` varchar(100) DEFAULT NULL,
  `ficha_tecnica` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id_propiedad`),
  KEY `FK_propiedades_tipospropiedad` (`id_tipo_propiedad`),
  KEY `FK_propiedades_zonas` (`id_zona`),
  KEY `FK_propiedades_usuarios` (`id_usuario`),
  KEY `FK_propiedades_asentamientos` (`id_asentamiento`),
  CONSTRAINT `FK_propiedades_asentamientos` FOREIGN KEY (`id_asentamiento`) REFERENCES `asentamientos` (`id_asentamiento`),
  CONSTRAINT `FK_propiedades_tipospropiedad` FOREIGN KEY (`id_tipo_propiedad`) REFERENCES `tipos_propiedad` (`id_tipo_propiedad`),
  CONSTRAINT `FK_propiedades_usuarios` FOREIGN KEY (`id_usuario`) REFERENCES `usuarios` (`id_usuario`),
  CONSTRAINT `FK_propiedades_zonas` FOREIGN KEY (`id_zona`) REFERENCES `zonas` (`id_zona`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

/*Data for the table `propiedades` */

